use std::cmp::max;
use std::collections::HashMap;

struct Solution;

const MAX_CHAR: usize = 256;

#[inline(always)]
fn sliding_window_solution(s: String) -> i32 {
    let mut left_window_index = 0;
    let mut right_window_index = 0;
    let size = s.len();

    let mut max_length = 0;

    let mut chars: HashMap<char, usize> = HashMap::with_capacity(MAX_CHAR);

    if size < 1 {
        return size as i32;
    }

    while right_window_index < size {
        let character = s.chars().nth(right_window_index).unwrap();

        if chars.contains_key(&character) {
            left_window_index = max(
                chars.get(&character).unwrap().clone() + 1,
                left_window_index,
            );
        }

        let current_length = right_window_index - left_window_index + 1;
        if max_length < current_length {
            max_length = current_length;
        }

        chars.insert(character, right_window_index);
        right_window_index += 1;
    }

    max_length as i32
}

impl Solution {
    pub fn length_of_longest_substring(s: String) -> i32 {
        let opt = sliding_window_solution(s);
        opt
    }
}

